    [],nt"revision_timestamp": "2015-07-23T03:28:09.422550",nt"name": "st-vincent-national-wildlife-refuge-forest-management-plan",nt"isopen":
    false,nt"url": null,nt"notes": "Virgin timber stood on St. Vincent Island
    until the early forties when sold by the estate of Dr. Pierce. Other timber cuts
    were made during the period I960 through 1965, These cuts, in the form of seed tree
    cuttings and partial thinnings, in most instances reduced the timbered areas to
    sparse stands of slash pine. The seed tree cut was primarily the residual virgin
    timber on the sand dune ridges. An exception in the last timber harvesting permit
    left the southeast portion of the island around the lodge untreated. The hardwood
    timbered areas were also left untreated. The vegetative types have remained the
    same through the cuttings. One favorable aspect of the islands rolling dunes is
    the pine lands are interspersed with hardwoods. This provides an ideal  composition
    of vegetation favorable for wildlife management, especially for the upland game
    species. Two types of forest management are being used to fulfill refuge objectives:
    regulated and publicuse management.",nt"license_title": "License Not Specified",nt"extras":
